<script>
  $(document).ready(function () {
  $(".hide").hide();

  $(".square-marker").click(function () {
    $(".hide").hide();
    $(".square-txt").fadeIn(300);
  });

  $(".star-marker").click(function () {
    $(".hide").hide();
    $(".star-txt").fadeIn(300);
  });
});
</script>
